script: |
  super -f text -I q2332.spq | sort > q2332.out

inputs:
  - name: q2332.spq
    data: |
      SELECT DISTINCT - col1 * ( ( + col0 ) ) + - col2 * + col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q2332.out
    data: |
      -1210
      -1482
      -2288
